(1, 1, 13, '', 'Proprietorship', 'Proprietorship Registration', NULL, , '1755682795_472514bc8da09a548ef5.webp', 1, NULL, , NULL, NULL, NULL, NULL, NULL, NULL, 0x3c703e3c6272202f3e0d0a266e6273703b266e6273703b266e6273703b266e6273703b266e6273703b266e6273703b266e6273703b266e6273703b266e6273703b266e6273703b266e6273703b266e6273703b3c2f703e0d0a, 'proprietorship', 'Proprietorship Registration - Startup with SmartFilings', 'Complete your proprietorship registration online in less than 48 hours anywhere from India. Proprietorship startup with GST registration and IT filing starting at less than Rs.1999 per year.', 'Proprietorship Registration, Sole Proprietorship, Proprietorship Firm Registration, Register a Proprietorship, Start a Proprietorship, Proprietorship Registration in vellore, company registration proprietorship firm, proprietary company registration, proprietorship company registration online, register proprietorship company online, register proprietorship firm online, business registration for sole proprietorship, online registration for proprietorship firm, register your sole proprietor business, firm registration for proprietorship, sole company registration, company registration proprietorship, proprietorship company registration, sole proprietorship registration for online business, register my sole proprietorship, individual firm registration, sole proprietorship application, sole proprietorship company registration, register business name sole trader, sole proprietorship firm registration online, register company sole proprietorship, proprietorship firm registration online, business name registration for sole proprietorship, proprietorship business registration, registration of proprietorship firm online, proprietorship registration cost, register proprietorship firm, new proprietorship firm registration, sole prop registration, proprietorship registration online, sole proprietorship registration online, sole proprietorship business registration, gst for sole proprietorship, proprietorship firm registration mca, gstin registration for proprietorship, msme sole proprietorship registration, single proprietorship registration, msme proprietorship registration, gst for proprietorship, register sole proprietorship online, gst apply for proprietorship, gst registration sole proprietorship, proprietorship firm registration, sole proprietorship registration cost, gst registration for sole proprietorship firm, gst registration for proprietorship online, sole proprietorship registration, register sole proprietorship, udyog aadhar for sole proprietorship, registering a business sole proprietorship, proprietorship registration, sole proprietorship firm registration, open a proprietorship firm, register gst for proprietorship, gst registration proprietorship, proprietorship register, cost to register sole proprietorship, cost of registering sole proprietorship, firm registration proprietorship, gst proprietorship registration, proprietorship gst registration, cost of proprietorship firm registration, proprietorship firm gst registration, gst registration for proprietorship, apply gst for proprietorship firm, proprietorship gst, gst registration for sole proprietorship, gst registration for proprietorship firm, gst registration of proprietorship, gst for proprietorship firm, new gst registration for proprietorship, gst registration online for sole proprietorship, gst proprietorship, msme sole proprietorship, smart filings, proprietorship in {city}', '', NULL, NULL, '2025-08-20 15:09:55', NULL, 0, '[]'),
(2, 1, 13, '', 'Partnership Firm', 'Get your partnership registered with India\'s leading platform starting.', '<p>Empower your business with our comprehensive IT services and drive growth.</p>\r\n\r\n<ul>\r\n	<li>Fastest registration turnaround time in India with tickGuaranteed document upload to the government portal under 7 days or get a full refund</li>\r\n	<li>Transparent process starting from Just ?499 + GST</li>\r\n	<li>Fastest registration turnaround time in India with tickGuaranteed document upload to the government portal under 7 days or get a full refund</li>\r\n	<li>Transparent process starting from Just ?499 + GST</li>\r\n	<li>Fastest registration turnaround time in India with tickGuaranteed document upload to the government portal under 7 days or get a full refund</li>\r\n	<li>Transparent process starting from Just ?499 + GST</li>\r\n</ul>\r\n', , '02-02-2022-11-23-45-am2.jpg', 1, 'Sole proprietorship registration online in India is now a super fast process. Thanks to Zolvit! To guarantee that your papers are always secure, Zolvit implements the best security protocols available in the market.', , NULL, '', NULL, '[{\"qsn\":\"Where is my order? Quisque molestie\",\"ans\":\"Provide a step-by-step guide on how users can browse and book travel services on your platform. Include information on searching for destinations, selecting dates, choosing accommodation, and completing the booking process. Mention any special features or tools that can help users find the best deals.\"}]', '<p>A sole proprietorship company is owned and run by just one person. This form of business is one of the most popular ones to start in the unsystematic sector, especially among merchants and small dealers, because it can be established in just fifteen days. A sole proprietorship firm does not need to register because it is recognised by other registrations, such as GST and much more. However, it does not have perpetual existence and its obligation is unbounded. Since the owner and the company are the same, a proprietorship cannot have other partners or shareholders. Furthermore, the proprietor&#39;s minimal liability from the business operations carried out under the sole proprietorship is unprotected. Therefore, small firms with no more than 5 employees are best served by this type of corporate entity.</p>\r\n', '[{\"image_name\":\"img2.jpg\",\"image_path\":\"175863142510overview_images.webp\",\"image_alt_text\":\"\"},{\"image_name\":\"img1.jpg\",\"image_path\":\"175863142511overview_images.webp\",\"image_alt_text\":\"\"}]', , 'partnership-firm', 'Partnership Firm Registration - Startup with Smart Filings', 'Step by step guide on how to register a Partnership firm online in India, partnership firm registration fees and download partnership registration certificate', 'partnership firm, partnership firm registration online, partnership deed, partnership deed format partnership registration , partnership registration, partnership deed, partnership agreement, partnership deed registration, partnership firm process and procedure, firm registration online, what is partnership, incorporate partnership, partnership firm, partnership firm registration, partnership firm process and procedure, what is partnership, how to register a firm, how to register a partnership firm, procedure of registration of partnership firm, partnership firm registration process, formation of partnership, registration of partnership firm under Indian partnership, register partnership firm, what is partnership firm, Partnership Firm Registration in vellore, smart filings', '', NULL, NULL, '2025-09-23 18:13:45', NULL, 0, '[]'),
