INSERT INTO `testimonial` (`id`, `name`, `designation`, `message`, `image`, `status`, `add_by`, `add_date_time`, `update_date_time`, `update_history`, `slug`, `is_delete`) VALUES
(14, 'Rajesh Mehta', 'New Delhi', 'Ally Legal Services handled my consumer dispute case with utmost professionalism. The team listened carefully to my concerns and took prompt action. The outcome was in my favor, and I truly appreciate their dedication.', NULL, 1, 1, '2025-09-18 11:10:34', '2025-09-18 11:10:34', NULL, NULL, 0),
(15, 'Neha Kapoor', 'Mumbai', 'I approached the firm for guidance on corporate law matters. Their lawyers explained everything clearly and assisted with all necessary documentation. Thanks to them, my business is now running smoothly without legal stress.', NULL, 1, 1, '2025-09-18 11:10:52', '2025-09-18 11:10:52', NULL, NULL, 0),
(16, 'Amit Sinha', 'Lucknow', 'My property dispute was resolved efficiently by Ally Legal Services. They provided regular updates, guided me through the process, and ensured a positive settlement. Highly reliable firm.', NULL, 1, 1, '2025-09-18 11:11:10', '2025-09-18 11:11:10', NULL, NULL, 0),
(17, 'Simran Kaur', 'Chandigarh', 'I consulted them for trademark registration. The process was simple, quick, and well-handled by their team. My brand is now legally protected. Highly recommended for intellectual property matters.', NULL, 1, 1, '2025-09-18 11:12:28', '2025-09-18 11:12:28', NULL, NULL, 0),
(18, 'Anjali Verma', 'Jaipur', 'In a sensitive family matter, I received not only professional but also compassionate legal support. The lawyer truly understood my situation and suggested the best possible solution. I am very grateful for their help.', NULL, 1, 1, '2025-09-18 11:12:46', '2025-09-18 11:12:46', NULL, NULL, 0);
